import React from 'react'

class WeatherTile extends React.Component {
  constructor(props) {
  super(props)
  }

  render() {
    return(
      <div className="tile">
        <div className="weatherIco">
          <h1>{this.props.main}</h1>
        </div>
      </div>
)
  }
}
export default WeatherTile
